import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import firebaseGetRealtimeData from "../../../functions/firebase/storage/useRealtimeData";
import ErrorPage from "../../../ErrorPage";
import Section from "../../../components/Section";
import css from "../../../styles/pages/games/LiveViewNomination.module.css";
import Button from "../../../components/Button";
import devConsole from "../../../functions/devConsole";

export default function LiveView_Nomination() {
  const { gameID } = useParams<{ gameID: string }>();
  const [currentRound, setCurrentRound] = useState(0);
  const [scores, setScores] = useState<
    | {
        player: string;
        scores: { roundScore: number; guess: number; runningTotal: number }[];
      }[]
    | undefined
  >(undefined);
  const [JsonObject, setJsonObject] = useState<{
    JSON?: string;
    currentRound?: number;
  }>({});
  const [error, setError] = useState<boolean>(false);
  const [largeText, setLargeText] = useState(false);
  const [fullscreen, setFullscreen] = useState(false);

  useEffect(() => {
    if (!gameID) {
      setError(true);
      return;
    }
    firebaseGetRealtimeData(
      "games",
      gameID,
      setJsonObject as React.Dispatch<React.SetStateAction<unknown>>,
      setError
    );
  }, [gameID]);

  useEffect(() => {
    if (JsonObject && JsonObject.JSON) {
      setScores(
        JSON.parse(JsonObject.JSON) as {
          player: string;
          scores: { roundScore: number; guess: number; runningTotal: number }[];
        }[]
      );
    }
    if (JsonObject && JsonObject.currentRound !== undefined) {
      setCurrentRound(JsonObject.currentRound);
    }
  }, [JsonObject]);

  useEffect(() => {
    document.addEventListener("fullscreenchange", (e) => {
      devConsole.log("Fullscreen change", e);
      if (!document.fullscreenElement) {
        setFullscreen(false);
        document.documentElement.classList.remove(css.nominationFullscreen);
      }
    });
  }, []);

  if (error || !gameID)
    return <ErrorPage code={404} error="Error fetching game data" />;

  return (
    <Section
      id="liveView-nomination"
      className={css.nomination + ` ${largeText ? css.largeText : ""}`}
      container={{ className: css.nominationContainer }}
    >
      <div className={css.controls}>
        <Button
          onClick={() => {
            if (!document.fullscreenElement) {
              document.documentElement.requestFullscreen();
              document.documentElement.classList.add(css.nominationFullscreen);
              setFullscreen(true);
            } else {
              if (document.exitFullscreen) {
                document.exitFullscreen();
                document.documentElement.classList.remove(
                  css.nominationFullscreen
                );
                setFullscreen(false);
              }
            }
          }}
          style="primary"
          title="Fullscreen"
          icon={{ gficon: fullscreen ? "fullscreen_exit" : "fullscreen" }}
          width="fit-content"
        >
          {fullscreen ? "Exit" : "Enter"} Fullscreen
        </Button>
        <Button
          onClick={() => {
            setLargeText((prev) => !prev);
          }}
          style="secondary"
          title="Enlarge"
          icon={{ gficon: largeText ? "arrows_input" : "arrows_output" }}
          width="fit-content"
        >
          {largeText ? "Shrink" : "Enlarge"}
        </Button>
      </div>
      <div className={css.scoresContainer}>
        <RoundNumberRenderer
          index={currentRound}
          numberOfPlayers={scores?.length || 0}
        />
        {scores && scores.length > 0 ? (
          scores.map((player, index) => (
            <PlayerRenderer key={index} player={player} index={currentRound} />
          ))
        ) : (
          <p>No players found.</p>
        )}
      </div>
    </Section>
  );
}

function PlayerRenderer(props: {
  player: {
    player: string;
    scores: { roundScore: number; guess: number; runningTotal: number }[];
  };
  index: number;
}) {
  const { player, index } = props;
  return (
    <div key={index} className={css.player}>
      <span className={css.playerName}>{player.player}</span>
      <div className={css.round}>
        <span className={css.guess}>{player.scores[index]?.guess}</span>
        <span className={css.scored}>{player.scores[index]?.roundScore}</span>
      </div>
      <span className={css.total}>{player.scores[index]?.runningTotal}</span>
    </div>
  );
}

