function RoundNumberRenderer(props: {
  index: number;
  numberOfPlayers: number;
}) {
  const { index, numberOfPlayers } = props;

  const maxCards = Math.floor(52 / numberOfPlayers) * 2; // Assuming 4 players for maxCards calculation

  return (
    <div className={css.roundNumberContainer}>
      <span className={css.roundNumber}>
        {index + 1}
      </span>
      <span className={css.roundCardNumber}>
        {index < maxCards / 2 ? maxCards / 2 - index : index - maxCards / 2 + 1}
      </span>
      <SuitRenderer index={index} />
    </div>
  );
}
